import React from 'react'
import one from '../media/01.mp3'
import two from '../media/02.mp3'

const data = [
{
	id: '01',
	src: one,
},
{
	id: '02',
	src: two,
}];

const List = () => (
  <ul>
    {data.map(item => (
      <div key={item.id}>
        <div>{item.id}</div>
        <audio id='audio' controls src={item.src}></audio>
      </div>
    ))}
  </ul>
);


export default function Tracks(props) {
	return (
		<div className='title'>
			<h2>Tracks</h2>
			<List />
		</div>
		)
}
